import React from 'react';
import { MapContainer, TileLayer } from 'react-leaflet'; // Import required components
import 'leaflet/dist/leaflet.css'; // Import Leaflet CSS
import { render } from 'react-dom';

function MapPlaceholder() {
  return (
    <p>
      Map of Braunschweig.{' '}
      <noscript>You need to enable JavaScript to see this map.</noscript>
    </p>
  );
}

function MapWithPlaceholder() {
  return (
    <MapContainer
      center={[52.2665, 10.5268]} // Center over Braunschweig
      zoom={13} // Zoom level
      scrollWheelZoom={false} // Disable scroll wheel zoom
      style={{ height: '600px', width: '100%' }} // Set height and width
      placeholder={<MapPlaceholder />}>
      <TileLayer
        attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
        url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png" // URL for OSM tile layer
      />
    </MapContainer>
  );
};

export default BubbleMap;
